tables.table_schema:
CREATE TABLE Diseases (
    disease_id UUID,
    disease_name VARCHAR(50),
    severity_level INT,
    PRIMARY KEY (disease_id)
);

CREATE TABLE HealthRecords (
    record_id INT PRIMARY KEY,
    patient_id INT,
    record_date DATE,
    diagnosis TEXT
);

CREATE TABLE DemographicInformation (
    patient_id INT PRIMARY KEY,
    age INT,
    gender TEXT,
    ethnicity TEXT
);

CREATE TABLE RiskFactors (
    risk_id INT PRIMARY KEY,
    patient_id INT,
    risk_factor TEXT,
    risk_level TEXT
);

CREATE TABLE PopulationStatistics (
    location_id INT PRIMARY KEY,
    region TEXT,
    population_size INT,
    at_risk_percentage DECIMAL
);

CREATE TABLE DiseaseOutbreaks (
    outbreak_id INT PRIMARY KEY,
    disease_name TEXT,
    outbreak_date DATE,
    affected_population INT
);
